const fetch = require('node-fetch');       

function search(query, cb) {
    //return fetch(`http://localhost/api/lee?q=${query}`,{method: 'GET'})
    return fetch(`http://localhost/api/marco?q=${query}`,{method: 'GET'})
      .then(res => res.text())
      .then(cb);
  }
  
  const Client = { search };
  export default Client;
